import React from "react";
import ReactDOM from "react-dom";
import '../src/index.css';
import data from "./data";
// console.log(data);

function Card(data){
  return(
    <>
    <div className="cardss">
 <div className="Card1">
  <img src={data.imgsrc}/>
  <span>Netflix Original Series</span>
  <h1>One Day</h1>
  <a  target="_blank" href="https://www.netflix.com/watch/81256740?tctx=0%2C0%2C%2C%2C%2C%2C%2C%2C%2CVideo%3A81256740%2C">
  <button>
    Watch Now
  </button>
  </a>

  </div>
 </div>
    </>
  )
}

ReactDOM.render(
  <>

  <div className="cards">
  <h1 >List of Netflix Series</h1>

  </div>

  </>,document.getElementById('root')
)
